#BlockFi founder and CEO Zac Prince said Wednesday that a funding deal from FTX allowed the company to bolster its balance sheet and &quot;navigate these market conditions from a position of strength.&quot; 

However, speaking to CNBC, the head of the cryptocurrency exchange pushed back on the idea that the firm was close to becoming another high-profile casualty of the current market downturn, saying its situation was not comparable to those of flameouts like Celsius and Luna. 

Drawing parallels to 2008, when a bankruptcy at Lehman Brothers sparked the beginning of the financial crisis, Prince said, &quot;It&#39;s night and day. You can&#39;t compare Goldman to Lehman Brothers in terms of how they&#39;ve continued to operate.&quot; 

He added: &quot;With the passing of time, folks will realize how different platforms like BlockFi are from some of those [others].&quot; 

